var fileJSON=[{"path":"/home/joerock/Documents/TFM/Quartus_Sim-Em/Squeezenet/device/v1.3/squeezenet/squeezenet_ST.cl", "name":"squeezenet_ST.cl", "has_active_debug_locs":false, "absName":"/home/joerock/Documents/TFM/Quartus_Sim-Em/Squeezenet/device/v1.3/squeezenet/squeezenet_ST.cl", "content":"//maxPool2d \012//kernel_size=3 stride=2\012//output one feature map per kernel\012__kernel void maxpool2d(\012	const int input_size,\012	const int output_size,\012    const int channel_size,\012	__global const float* restrict input_im,\012    __global float* restrict output_im)\012{\012\012    for(int channel_index = 0; channel_index < channel_size; channel_index++)\012    {\012        //loop over output feature map\012        for(int i = 0; i < output_size; i++)//row\012        {\012            for(int j = 0; j < output_size; j++)//col\012            {\012                //find the max value in 3x3 reigon \012                //to be one element in the output feature map\012                float tmp = 0.0;\012\012                #pragma unroll 1\012                for(int k = 0; k < 3; k++)//row\012                {\012                    #pragma unroll 1\012                    for(int l = 0; l < 3; l++)//col\012                    {\012                        float value = input_im[(i * 2 + k) * input_size  + j * 2 + l ];\012                        if(value > tmp)\012                            tmp = value;\012                    }\012                }\012                //store the result to output feature map\012                output_im[i * output_size + j] = tmp;\012            }\012        }\012    \012        input_im += input_size * input_size;\012        output_im += output_size * output_size;\012    }\012}\012\012//3x3 convolution layer\012//output one feature map per kernel\012__kernel void conv2d3x3(\012	const int input_channels, const int input_size,\012	const int pad, const int stride,\012	const int start_channel, //start_channel is for 1x1 feature map in fire layer\012	const int output_size,\012    const int filter_size,\012	__global const float* restrict input_im,\012	__global const float* restrict filter_weight,\012	__global const float* restrict filter_bias,\012	__global float *restrict output_im\012	)\012{\012	\012	//filter_weight += filter_index * input_channels * 9;\012	output_im += start_channel * output_size * output_size;\012	\012	//loop over output feature map\012	for(int filter_index = 0; filter_index < filter_size; filter_index++)\012	{\012        float bias = filter_bias[filter_index];\012\012		for(int i = 0; i < output_size; i++)\012		{\012            for(int j = 0; j < output_size; j++)\012            {\012                //compute one element in the output feature map\012                float tmp = bias;\012\012                //compute dot product of 2 input_channels x 3 x 3 matrix\012                for(int k = 0; k < input_channels; k++)\012                {\012                    #pragma unroll\012                    for(int l = 0; l < 3; l++)\012                    {\012                        int h = i * stride + l - pad;\012                        for(int m = 0; m < 3; m++)\012                        {\012                            int w = j * stride + m - pad;\012                            if((h >= 0) && (h < input_size) && (w >= 0) && (w < input_size))\012                            {\012                                tmp += input_im[k * input_size * input_size + h * input_size + w]\\\012                                   * filter_weight[9 * k + 3 * l + m];\012                            }\012                        }\012                    }\012                }\012\012                //add relu activation after conv\012                output_im[i * output_size + j] = (tmp > 0.0) ? tmp : 0.0;                 \012            }\012		}\012        \012        filter_weight += input_channels * 9;\012        output_im += output_size * output_size;\012	}\012}\012\012//1x1 convolution layer as a single kernel (V5)\012//output one feature map per kernel\012\012__kernel void conv2d1x1(\012	const int input_channels, \012    const int input_size,\012    const int filter_size,\012	__global const float* restrict input_im,\012	__global const float* restrict filter_weight,\012	__global const float* restrict filter_bias,\012	__global float *restrict output_im)\012{\012	// Adding restrict keyword\012    //loop over filters\012	for(int f_i = 0; f_i < filter_size; f_i++)\012	{\012        //filter_weight += f_i * input_channels;\012\012        float bias = filter_bias[f_i];\012		\012        // output_im += input_size * input_size;//start_channel is for 1x1 feature map in fire layer\012	\012		for(int ij = 0; ij < (input_size * input_size); ij++)\012		{\012			float tmp = bias;\012			// int loc = i * input_size + j; // this is equal to ij\012\012			for(int k = 0; k < input_channels; k++)\012			{\012				//float8 weight = filter_weight[k];\012				//float8 feature;\012				tmp += input_im[k * input_size * input_size + ij] * filter_weight[k + f_i * input_channels];\012			}\012			//add relu after conv\012			output_im[ij + (input_size * input_size * f_i)] = (tmp > 0.0) ? tmp : 0.0;\012            //output_im[ij] = (tmp > 0.0) ? tmp : 0.0;\012		}\012        //filter_weight += input_channels;	\012        //output_im += input_size * input_size;//start_channel is for 1x1 feature map in fire layer\012	\012	}\012}\012\012//last layer use a 13 x 13 avgPool layer as classifier\012//one class score per kernel\012__kernel void avgpool2d(\012	__global const float* restrict input_im,\012	__global float* restrict output_im)\012{\012	// int class_index = get_global_id(0);//get class score index\012    \012    //Since it's the final layer, we know that there are only 1000 classes\012    \012	//input_im += 169 * class_index;\012\012	for(int class_index = 0; class_index < 1000; class_index++)\012    {\012            \012        float tmp = 0.0f;\012\012        for(int i = 0; i < 169; i++)\012        {\012            tmp += input_im[class_index * 169 + i];\012        }\012\012        output_im[class_index] = tmp / 169.0;\012    }\012}\012"}];
